function municipiosapi(){
    var myHeaders = new Headers();
    myHeaders.append("session-token", sessionStorage.token_camguard);
  
    var requestOptions = {
        method: 'GET',
        headers: myHeaders,
        redirect: 'follow'
    };
  
    fetch("", requestOptions)
    .then(response => response.text())
    .then(function(result){
        let response = result;
        response = JSON.parse(response);
        details(response);
  });
  };

  window.onload =function() {
    municipiosapi();
  }